CREATE TABLE ARQUIVO(
    NR_ID NUMBER(10) NOT NULL,
    DS_NOME VARCHAR(256) NOT NULL,
    BL_ARQUIVO BLOB NULL,
    CONSTRAINT PK_ARQIVO PRIMARY KEY (NR_ID)
);
CREATE SEQUENCE ARQUIVO_SEQ;

CREATE TABLE AGRUPADOR_ARQUIVO(
    NR_ID NUMBER(10) NOT NULL,
    NR_AGRUPADOR NUMBER(10) NOT NULL,
    NR_ID_ARQUIVO NUMBER(10) NOT NULL,
    CONSTRAINT PK_AGRUPADOR_ARQUIVO PRIMARY KEY (NR_ID),
    CONSTRAINT UK_AGRUPADOR_ARQUIVO UNIQUE (NR_AGRUPADOR, NR_ID_ARQUIVO),
    CONSTRAINT FK_AGR_ARQ_ID_ARQUIVO FOREIGN KEY (NR_ID_ARQUIVO) REFERENCES ARQUIVO(NR_ID)
);
CREATE SEQUENCE AGRUPADOR_ARQUIVO_SEQ;

CREATE TABLE USUARIO(
    NR_ID NUMBER(10) NOT NULL,
    DS_EMAIL VARCHAR2(100) NOT NULL,
    DS_NOME_EXIBIDO VARCHAR2(50),
    DS_SENHA VARCHAR2(256) NOT NULL, --SHA512,
    NR_AGRUPADOR_ARQUIVO NUMBER(10) NULL,
    CONSTRAINT PK_USUARIO PRIMARY KEY (NR_ID),
    CONSTRAINT UK_USUA_DS_EMAIL UNIQUE (DS_EMAIL)
);
CREATE SEQUENCE USUARIO_SEQ;

CREATE TABLE PAIS (
    NR_ID NUMBER(19) NOT NULL,
    NR_BACEN NUMBER(10),
    DS_NOME VARCHAR2(60 CHAR),
    DS_NOME_PT VARCHAR2(60 CHAR),
    DS_SIGLA VARCHAR2(2 CHAR),
    CONSTRAINT PK_PAIS PRIMARY KEY (NR_ID)
);
CREATE SEQUENCE PAIS_SEQ;

CREATE TABLE ESTADO (
    NR_ID NUMBER(19) NOT NULL,
    DS_DDD VARCHAR2(50 CHAR),
    NR_IBGE NUMBER(10),
    DS_NOME VARCHAR2(75 CHAR),
    DS_UF VARCHAR2(2 CHAR),
    NR_ID_PAIS NUMBER(19),
    CONSTRAINT PK_ESTADO PRIMARY KEY (NR_ID),
    CONSTRAINT FK_ESTADO_PAIS FOREIGN KEY (NR_ID_PAIS) REFERENCES PAIS(NR_ID)
);
CREATE SEQUENCE ESTADO_SEQ;

CREATE TABLE CIDADE (
    NR_ID NUMBER(19) NOT NULL,
    NR_IBGE NUMBER(10) NOT NULL,
    DS_NOME VARCHAR2(120 CHAR) NOT NULL,
    NR_ID_ESTADO NUMBER(19) NOT NULL,
    CONSTRAINT PK_CIDADE PRIMARY KEY (NR_ID),
    CONSTRAINT FK_CIDADE_ESTADO FOREIGN KEY (NR_ID_ESTADO) REFERENCES ESTADO(NR_ID)
);
CREATE SEQUENCE CIDADE_SEQ;

CREATE TABLE INSTITUICAO(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_CIDADE NUMBER(10) NOT NULL,
    NR_ID_ESTADO NUMBER(10) NOT NULL,    
    NR_ID_USUARIO NUMBER(10) NOT NULL,
    DS_RAZAO_SOCIAL VARCHAR2(100),
    DS_RAMO VARCHAR2(50),
    CD_CNPJ VARCHAR2(18),
    DS_RESUMO VARCHAR2(100),
    DS_DESCRICAO VARCHAR2(250),
    DS_EMAIL_CONTATO VARCHAR(100),
    DS_TELEFONE VARCHAR2(50),
    DS_HORARIO_FUNCIONAMENTO VARCHAR2(50),
    CONSTRAINT PK_INSTITUICAO PRIMARY KEY (NR_ID),
    CONSTRAINT UK_INSTIT_CD_CNPJ UNIQUE (CD_CNPJ)
);
CREATE SEQUENCE INSTITUICAO_SEQ;

CREATE TABLE UNIVERSITARIO(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_USUARIO NUMBER(10) NOT NULL,
    NR_ID_INSTITUICAO NUMBER(10) NOT NULL,
    NR_ID_CIDADE NUMBER(10) NOT NULL,
    NR_ID_ESTADO NUMBER(10) NOT NULL,
    DS_NOME VARCHAR2(50),
    DS_SOBRENOME VARCHAR2(100),
    DS_TELEFONE VARCHAR2(20),
    DS_GRAU VARCHAR2(20),
    CONSTRAINT PK_UNIVERSITARIO PRIMARY KEY (NR_ID),
    CONSTRAINT FK_UNIVER_USUARI FOREIGN KEY (NR_ID_USUARIO) REFERENCES USUARIO(NR_ID),
    CONSTRAINT FK_UNIVER_INSTIT FOREIGN KEY (NR_ID_INSTITUICAO) REFERENCES INSTITUICAO(NR_ID)
);
CREATE SEQUENCE UNIVERSITARIO_SEQ;

CREATE TABLE CURSO(
    NR_ID NUMBER(10) NOT NULL,
    DS_CODIGO VARCHAR2(100) NOT NULL,
    DS_NOME VARCHAR2(50),
    DS_DESCRICAO VARCHAR2(100),
    CONSTRAINT PK_CURSO PRIMARY KEY (NR_ID)    
);
CREATE SEQUENCE CURSO_SEQ;

CREATE TABLE PROPOSTA(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_CURSO NUMBER(10) NOT NULL,
    NR_ID_INSTITUICAO NUMBER(10) NOT NULL,
    DS_NOME VARCHAR2(100),
    DS_DESC_PROJETO VARCHAR(250),
    CD_STATUS VARCHAR2(2),
    DS_REQUISITO VARCHAR2(250),
    QT_PARTICIPANTES NUMBER(10),
    NR_DURACAO NUMBER(10),
    DS_INFO_CONTATOS VARCHAR2(100),
    DS_TIPO VARCHAR2(50),
    DT_GERACAO DATE NOT NULL,
    NR_AGRUPADOR_ARQUIVO NUMBER(10) NULL,
    CONSTRAINT PK_PROPOSTA PRIMARY KEY (NR_ID),
    CONSTRAINT FK_PROPOS_CURSO FOREIGN KEY (NR_ID_CURSO) REFERENCES CURSO(NR_ID),
    CONSTRAINT FK_PROPOS_INSTIT FOREIGN KEY (NR_ID_INSTITUICAO) REFERENCES INSTITUICAO(NR_ID)
);
CREATE SEQUENCE PROPOSTA_SEQ;

CREATE TABLE PROPOSTA_UNIVERSITARIO(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_UNIVERSITARIO NUMBER(10) NOT NULL,
    NR_ID_PROPOSTA NUMBER(10) NOT NULL,
    CONSTRAINT PK_PROPOSTA_UNI PRIMARY KEY (NR_ID),
    CONSTRAINT FK_PROUNI_UNIVER FOREIGN KEY (NR_ID_UNIVERSITARIO) REFERENCES UNIVERSITARIO(NR_ID),
    CONSTRAINT FK_PROUNI_PROPOS FOREIGN KEY (NR_ID_PROPOSTA) REFERENCES PROPOSTA(NR_ID)
);
CREATE SEQUENCE PROPOSTA_UNIVERSITARIO_SEQ;

CREATE TABLE LOG_ACESSO(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_PROPOSTA NUMBER(10) NOT NULL,
    NR_ID_USUARIO NUMBER(10) NOT NULL,
    CONSTRAINT PK_LOG_ACESSO_ID PRIMARY KEY (NR_ID),
    CONSTRAINT FK_LOG_ACESSO_PROPOSTA FOREIGN KEY (NR_ID_PROPOSTA) REFERENCES PROPOSTA(NR_ID),
    CONSTRAINT FK_LOG_ACESSO_USUARIO FOREIGN KEY (NR_ID_USUARIO) REFERENCES USUARIO(NR_ID)
);
CREATE SEQUENCE LOG_ACESSO_SEQ;

CREATE TABLE INTERESSE(
    NR_ID NUMBER(10) NOT NULL,
    NR_ID_PROPOSTA NUMBER(10) NOT NULL,
    NR_ID_UNIVERSITARIO NUMBER(10) NOT NULL,
    DT_INTERESSE DATE NOT NULL,
    DS_STATUS VARCHAR(30) NOT NULL,
    CONSTRAINT PK_INTERESSE PRIMARY KEY (NR_ID),
    CONSTRAINT UK_INTERE_PRO_UNI UNIQUE (NR_ID_PROPOSTA, NR_ID_UNIVERSITARIO),
    CONSTRAINT FK_INTERE_PROPOS FOREIGN KEY (NR_ID_PROPOSTA) REFERENCES PROPOSTA(NR_ID),
    CONSTRAINT FK_INTERE_UNIVER FOREIGN KEY (NR_ID_UNIVERSITARIO) REFERENCES UNIVERSITARIO(NR_ID)
);
CREATE SEQUENCE INTERESSE_SEQ;

CREATE TABLE SERVIDOR_EMAIL(
    NR_ID NUMBER(10) NOT NULL,
    DS_NOME VARCHAR2(90) NOT NULL,
    DS_ENDERECO_SMTP VARCHAR2(90) NOT NULL,
    NR_PORTA NUMBER(10) NOT NULL,
    NR_USA_SSL NUMBER(1) NOT NULL,
    CONSTRAINT PK_SERVIDOR_EMAIL PRIMARY KEY (NR_ID),
    CONSTRAINT UK_SEREMA_DS_NOME UNIQUE (DS_NOME)
);
CREATE SEQUENCE SERVIDOR_EMAIL_SEQ;

CREATE TABLE TOKEN(
    NR_ID NUMBER(10) NOT NULL,
    DS_TOKEN VARCHAR(36) NOT NULL,
    DT_DATA_LIMITE DATE NOT NULL,
    CONSTRAINT PK_TOKEN PRIMARY KEY (NR_ID),
    CONSTRAINT UK_TOKEN_TOKEN UNIQUE (DS_TOKEN)
);
CREATE SEQUENCE TOKEN_SEQ;

